import React from 'react';
import { Link } from 'react-router-dom';
import {
    DesktopLogo,
    MobileLogo,
    NavLogo
} from '../../components/Navigation/Style';
import Data from '../../Data';

const split = Data.home.name.split(" ");
const initials = split[0].charAt(0) + split[1].charAt(0);

const Logo = (props) => (
    <Link to="/home">
        <NavLogo>
            <DesktopLogo>
                {Data.home.name}
            </DesktopLogo>
            <MobileLogo>
                {initials}
            </MobileLogo>
        </NavLogo>
    </Link> 
);

export default Logo;
